static unsigned char *bmp2arr(const struct bitmap *bmp, int *arrlen)
{
	char width[32];
	char height[32];
	char max[32];
	int datalen;
	unsigned char *array, *arrp;
	int i;
	char c, *s;

	if (bmp->format != PGM_P5) {
		eprintf(AREA, "Unexpected bitmap format: %d", bmp->format);
		exit(1);
	}

	sprintf(width, "%d", bmp->width);
	sprintf(height, "%d", bmp->height);
	sprintf(max, "%d", bmp->max);
	*arrlen = 6 + strlen(width) + strlen(height) + strlen(max) +
		  (datalen = bmp->width * bmp->height);
	arrp = array = (unsigned char *)malloc(*arrlen * sizeof(unsigned char));

	*arrp++ = 'P';
	*arrp++ = '5';
	*arrp++ = '\n';

	s = width;
	while ((c = *s++))
		*arrp++ = c;
	*arrp++ = ' ';
	s = height;
	while ((c = *s++))
		*arrp++ = c;
	*arrp++ = '\n';

	s = max;
	while ((c = *s++))
		*arrp++ = c;
	*arrp++ = '\n';

	for (i = 0; i < datalen; i++) {
		arrp[i] = bmp->data[i];
	}
	return array;
}

int writebmp(struct bitmap *bmp, const char *path)
{
	int rawlen;
	int width;
	int height;
	int channels;

	unsigned char *raw = bmp2arr(bmp, &rawlen);
	unsigned char *img = stbi_load_from_memory(raw, rawlen, &width, &height,
						   &channels, 0);
	stbi_write_png(path, width, height, channels, img, width * channels);
	return 0;
}

